import React from "react";
import "./App.css";
import Comments from "./Comments"


function WorkoutCard ({ workout }) {

    const {workout_type, date, details, approx_duration} = workout

    return (
        <div id="workout_card">
            <h4 id="workout_date">{date}</h4>
            <h3 id="workout_type">{workout_type}</h3>
            <h4 id="workout_approx_duration">Approx. Duration: {approx_duration}</h4>
            <p id="workout_details">Workout Details: {details}</p>
            <Comments id="workout_comments"/>

        </div>
    )
}

export default WorkoutCard
